import React from 'react';
import './Footer.css';

const Footer = () => {
    return (
        <footer className='footer'>
            <hr />
            <div className='footer-left'>
                <p>SENSEI.AI LLC</p>
                <p>Northville, MI</p>
            </div>
        </footer>
    );
};

export default Footer;
